// Portfolio.js
import React from 'react';
import NavbarCasual from '../NavBar/NavbarCasual'; // Adjust the path based on your project structure
import NavbarProfessional from '../NavBar/NavbarProfessional'; // Adjust the path based on your project structure

const Portfolio = ({ isProfessional }) => {
  return (
    <div>
      {/* Render the appropriate navbar based on the prop */}
      {isProfessional ? <NavbarProfessional /> : <NavbarCasual />}

      <h1>Portfolio Page</h1>
      {/* Add your portfolio content here */}
    </div>
  );
};

export default Portfolio;
